var title_f17_3_17469="Complications of Kawasaki disease";
var content_f17_3_17469=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F56475&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F56475&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Complications of Kawasaki disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Complication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Frequency",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Shock",
"       </td>",
"       <td>",
"        ~7 percent",
"       </td>",
"       <td>",
"        <p>",
"         Associated features:",
"        </p>",
"        <ul>",
"         <li>",
"          Consumptive coagulopathy and cardiac abnormalities including impaired left ventricular systolic function, mitral regurgitation, and coronary artery abnormalities",
"         </li>",
"         <li>",
"          Higher C-reactive protein levels",
"         </li>",
"         <li>",
"          Less responsive to initial intravenous immunoglobulin therapy and more commonly require additional treatment",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td colspan=\"2\">",
"        Macrophage activation syndrome",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Reported rarely in children with persistent fever after IVIG treatment",
"         </li>",
"         <li>",
"          Heralded by fall in ESR due to consumptive coagulopathy; also marked by ferritin levels &gt;5000 ng/mL",
"         </li>",
"         <li>",
"          Treatment with intravenous methylprednisolone, biologic response modifiers, or cyclosporine may be needed",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Cardiac complications",
"       </td>",
"       <td>",
"        Coronary artery involvement",
"       </td>",
"       <td>",
"        <p>",
"         Nearly all patients with KD",
"        </p>",
"        <p>",
"         (Coronary artery ectasia - ~31 percent; coronary artery aneurysm -&nbsp;&lt;5 percent)",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Coronary artery aneurysms associated with:",
"        </p>",
"        <ul>",
"         <li>",
"          Age &lt;1 year or &gt;9 years",
"         </li>",
"         <li>",
"          Male sex",
"         </li>",
"         <li>",
"          Fever &ge;14 days",
"         </li>",
"         <li>",
"          Serum sodium &lt;135 mEq/L, hematocrit &lt;35 percent, white cell count &gt;12,000/mm",
"          <sup>",
"           3",
"          </sup>",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Depressed myocardial contractility",
"       </td>",
"       <td>",
"        Present in almost all patients with KD",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Includes myocarditis, cardiomyopathy, and left ventricular dysfunction",
"         </li>",
"         <li>",
"          Most commonly manifested by tachycardia and an S3 gallop; uncommonly may progress to heart failure",
"         </li>",
"         <li>",
"          Normal contractility typically is restored following treatment with intravenous immune globulin (IVIG)",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td colspan=\"2\">",
"        Noncoronary vascular involvement",
"       </td>",
"       <td>",
"        <p>",
"         Rare (peripheral)",
"        </p>",
"        <p>",
"         Very rare (visceral)",
"        </p>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Peripheral aneurysms may present as pulsatile masses in axillae or inguinal area",
"         </li>",
"         <li>",
"          Peripheral arterial obstruction can lead to ischemia and gangrene",
"         </li>",
"         <li>",
"          Most commonly occurs in children with severe KD, including significant coronary artery involvement",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td colspan=\"2\">",
"        Urinary abnormalities and renal disease",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Includes acute interstitial nephritis, mild proteinuria, acute renal failure, hemolytic-uremic syndrome, and immune complex-mediated glomerulonephritis",
"         </li>",
"         <li>",
"          IVIG may also cause acute renal injury, especially preparations using sucrose as a stabilizer",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td colspan=\"2\">",
"        Gastrointestinal abnormalities",
"       </td>",
"       <td>",
"        Mild GI manifestations occur commonly; severe involvement is rare",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Mild GI involvement includes gallbladder hydrops and cholestasis and paralytic ileus",
"         </li>",
"         <li>",
"          More severe involvement includes bile duct stenosis, appendicular vasculitis, hemorrhagic duodenitis, intestinal pseudo-obstruction, intussusception, and pancreatitis",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td colspan=\"2\">",
"        Sensorineural hearing loss",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Usually transient",
"         </li>",
"         <li>",
"          Persistent sensorineural hearing loss is associated with delayed use of IVIG, prolonged thrombocytosis, anemia, and an elevated erythrocyte sedimentation rate",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IVIG: intravenous immune globulin; ESR: erythrocyte sedimentation rate; KD: Kawasaki disease; GI: gastrointestinal.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
